import React, {useEffect, useState} from 'react'
import './css/center_menu.css'
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const Center_menu = () => {

  const Data = [
    {
        id: 1,
        title: 'repellendus id ullam',
        img: '../../img/l1.webp',
        label: 'Dolorem officiis temporibus. 0'
    },
    {
        id: 2,
        title: 'repellendus id ullam',
        img: '../../img/r1.webp',
        label: 'Dolorem officiis temporibus. 0'
    },
    {
        id: 3,
        title: 'repellendus id ullam',
        img: '../.././img/r1.webp',
        label: 'Dolorem officiis temporibus. 0'
    },
    {
        id: 4,
        title: 'repellendus id ullam',
        img: '../../img/l1.webp',
        label: 'Dolorem officiis temporibus. 0'
    },
];

var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 6000,
        pauseOnHover: true,
        appendDots: dots => (
            <div
                style={{
                    backgroundColor: "#ddd",
                    borderRadius: "10px",
                    marginTop: "10px",
                    padding: "20px"
                }}
            >
                <ul style={{ margin: "0px" }}>{Data.map((item) => (
          <div>
            <img src={item.img} alt="" style={{ width: "100%", height: "40vh" }} />
          </div>
        ))} </ul>
            </div>
        ),
    };

  return (
    <div className="main">
    <div style={{ margin: "30px" }} className="carousel">
      <h1>Basic carousel</h1>
      <Slider {...settings}>
        {Data.map((item) => (
          <div>
            <img src={item.img} alt="" style={{ width: "100%", height: "40vh" }} />
          </div>
        ))}
      </Slider>
  </div>
</div>
  )
}

export default Center_menu
